import React from 'react';
import logoSmall from '../assets/logo-small.png'

const Navbar = () => {

    return (
        <div className="navbar">
            <div className="navbar-content">
                <div className="navbar-items">

                    <img className="logo" src={logoSmall} alt="kaamyabi small logo" />
                    <input type="search" placeholder="Search answers" />
                    <div className="nav-cta text-bold">Sign in</div>

                </div>
            </div>

        </div>
    )


}

export default Navbar;
